import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="py-4 px-4 w-full">
        <div className="wrapper w-full flex justify-between gap-4 ">
            
            <div className="content w-2/3">
                Hello
            </div>

            <div className="hero w-1/3">
                <div className="hero-photo-wrapper flex justify-center py-4" >
                    <img src="./images/my-photo.jpg" alt="photo" />
                </div>
            </div>
        </div>
  </div>
  )
  
};

export default Header;
